import React from "react";
import * as myProjectService from "../../services/myProjectService";

import {
  Card,
  // CardHeader,
  CardBody,
  // CardTitle,
  CardFooter,
  Row,
  Col
} from "reactstrap";

import CardAuthor from "components/CardElements/CardAuthor.jsx";
// import FormInputs from "components/FormInputs/FormInputs.jsx";
import Button from "components/CustomButton/CustomButton.jsx";

import damirBosnjak from "assets/img/damir-bosnjak.jpg";
// import mike from "assets/img/mike.jpg";
// import ayoOgunseinde2 from "assets/img/faces/ayo-ogunseinde-2.jpg";
// import joeGardner2 from "assets/img/faces/joe-gardner-2.jpg";
// import clemOnojeghuo2 from "assets/img/faces/clem-onojeghuo-2.jpg";

class UserPage1 extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      myProject: []
    };
  }

  componentDidMount() {
    console.log("mounted");
    myProjectService
      .getAllProfiles()
      .then(this.onGetAllSuccess)
      .catch(this.onError);
  }

  onGetAllSuccess = response => {
    console.log("successful get all profiles");
    // debugger;
    this.setState({
      myProject: response.data.items
    });

    console.log(response.data.items);
  };

  onDeleteSuccess = () => {
    // console.log("delete success");
    // let list = [...this.state.myProject];
    // console.log(this.state.replies);
    // let newList = list.filter(object => object.id !== myProject.id);
    // // console.log(newComments);
    // this.setState({ list: [...newList] }, () => console.log(this.state));
  };

  onError = () => {
    console.log("error");
  };

  onProfileUpdate = (e, yoga) => {
    debugger;
    let id = yoga.id;
    this.props.history.push("/register/" + id, yoga);
  };

  onProfileDelete(e, yoga) {
    debugger;
    let id = yoga.id;
    // this.props.history.push("/user-page/", yoga);

    myProjectService
      .deleteProfile(id)
      .then(response => {
        let list = [...this.state.myProject];
        let newList = list.filter(object => object.id !== yoga.id);
        // console.log(newComments);
        this.setState({ myProject: [...newList] }, () =>
          console.log(this.state)
        );
      })
      .catch(this.onError);
  }

  mapProject = yoga => {
    return (
      <React.Fragment key={yoga.id}>
        {/* <div className="content"> */}
        {/* <Row> */}
        <Col md={4}>
          <Card className="card-user">
            <div className="image">
              <img
                src={
                  "https://images.pexels.com/photos/262325/pexels-photo-262325.jpeg?auto=compress&cs=tinysrgb&dpr=2&w=500"
                }
                alt="..."
              />
            </div>
            <CardBody>
              <CardAuthor
                avatar={yoga.image}
                avatarAlt="..."
                title={yoga.firstName + " " + yoga.lastName}
                // description="@chetfaker"
              />
              {/* Name: {yoga.firstName} {yoga.lastName} */}
              <p className="description text-center">
                {" "}
                Certifications: {yoga.certifications}
              </p>
              <p className="description text-center">
                {" "}
                Specializations: {yoga.specializations}
              </p>
              <p className="description text-center">
                {" "}
                Yoga Style: {yoga.yogaStyle}
              </p>
              <p className="description text-center"> Rates: {yoga.rates}</p>
              <p className="description text-center">
                {" "}
                Location: {yoga.location}
              </p>

              <p className="description text-center">Bio: {yoga.bio}</p>
            </CardBody>
            {/* <p className="description text-center"> Website: </p> */}
            <hr />
            <Col lg={12} className="mr-auto   text-center">
              <h7>
                Website:
                <br />
                <small>{yoga.website}</small>
              </h7>
            </Col>

            <CardFooter>
              <hr />
              <div className="button-container">
                <Row>
                  <Col xs={6} sm={6} md={6} lg={6} className="ml-auto">
                    {/* <Col xs={6} sm={6} md={6} lg={3} className="ml-auto"> */}
                    <h7>
                      Email:
                      <br />
                      <small>{yoga.email}</small>
                    </h7>
                  </Col>
                  <Col xs={6} sm={6} md={6} lg={4} className="mr-auto ml-auto">
                    <h7>
                      Phone:
                      <br />
                      <small>{yoga.phone}</small>
                    </h7>
                  </Col>
                </Row>
              </div>

              <hr />
              <Row>
                <div
                  onClick={e => this.onProfileUpdate(e, yoga)}
                  className=" ml-auto mr-auto"
                >
                  <Button size="sm" color="success">
                    Update
                  </Button>
                </div>
                <div
                  onClick={e => this.onProfileDelete(e, yoga)}
